window.bookSummaryJSON = "<p>Trapped in a dungeon. There's only one way out. Kill or be killed....</p> <p>An AI calling itself Schema has assimilated Earth into its System. As a consequence, everyone gained access to status screens, power-ups, and skills. This AI turned these concepts from fiction to fact. It's easy to become intoxicated with leveling up and becoming stronger. To some, it's too good to be true, like living out a dream.</p> <p>For Daniel, however, it's closer to a nightmare.</p> <p>He's in a bit of a predicament. Cracks in our dimensional fabric have unleashed terrifying beasts from dark, abyssal places. Schema organizes these cracks into dungeons, giving the native species of the planet a chance to fight back.</p> <p>Daniel finds himself stuck in one of these dungeons. It's time to break free, by any means necessary.</p> <p>Experience the start of an action-packed LitRPG apocalypse series with nearly 15 million views on Royal Road.</p>"; 
